'–ü–æ –∫–∞–∫–∏–º –ø—Ä–∏–∏–Ω–∞–º —Ç–≤–æ—è –º–∞–º–∞—à–∞ —Å—Ç–∞–ª–æ —à–ª—é—Ö–æ–π —Ç–∞–∫ –∫–∞–∫ –æ–Ω–∞ –Ω–∞—á–∞–ª–∞ –ø—Ä–∏–Ω–∏–º–∞—Ç—å –ø–æ –º–∏–ª–∏–æ–Ω–æ–≤ —á–ª–µ–Ω–æ–≤ –≤ –¥–µ–Ω—å –º—ã –ø—Ä–æ–∑–≤–∞–ª–∏ –µ–µ –µ–±–∞–Ω–Ω–∞—è –¥–∞–≤–∞–ª–∫–∞ —Ç–µ–ø–µ—Ä—å —Å–∞–º –ø–æ–¥—É–º–∞–π –ø–æ—á–µ–º—É œ∂—Ç–æ –±—è–ª–¥–∏–Ω–∞ –ø–∞–ª–∞ –≤ –Ω–∞—à–∏—Ö –≥–ª–∞–∑–∞—Ö. ',
