'–ù–µ –∫–∞–∫ –Ω–µ –ø–æ–π–º—É —Ç–≤–æ—è –º–∞—Ç—å –ø—Ä–∏—Ç–≤–æ—Ä—è–µ—Ç—å—Å—è –∏–ª–∏ –æ–Ω–∞ –Ω–∞ –¥–µ–ª–µ —à–ª—é—Ö–∞–¥—É–º–∞—é —á—Ç–æ –µ–π –Ω–µ —Å—Ç–æ–∏—Ç –ø—Ä–∏—Å—É—Ç—Å—Ç–≤–æ–≤–∞—Ç—å –≤ –Ω–∞—à–µ–π –∂–∏–∑–Ω–∏ –Ω–æ —Å–æ—Å–µ—Ç –æ–Ω–∞ –≤–µ–ª–∏–∫–æ–ª–µ–ø–Ω–∞ —Ç–æ–ª—å–∫–æ –∏–∑ –∑–∞ œ∂—Ç–æ–≥–æ –º—ã –Ω–µ —Å–æ–∂–≥–ª–∏ –µ–µ –Ω–∞ –∫—Å–æ—Ç—Ä–µ –∫–∞–∫ –≤–µ–¥—å–º—É ',
'–ü–æ –ø—Ä–∏–Ω—Ü–∏–ø–∞–º —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –ø–æ–Ω–∏–º–∞–µ—Ç –Ω–∞–º–µ–∫–æ–≤ –ø–æœ∂—Ç–æ–º—É –ø—Ä–∏—Ö–æ–¥–∏—Ç—å—Å—è œ∂—Ç–æ–π —à–∞–ª–∞–≤–µ –≤—Å–µ –æ–±—ä–µ—Å–Ω—è—Ç—å –Ω–∞ –ø—Ä—è–º—É—é —Ç–∞–∫ —á—Ç–æ –ø–æ–¥—Ö–æ–¥–∏—à—å –∫ –Ω–µ–π –∏ –≥–≤–æ–æ—Ä–∏—à—å –ø–æ—Å–æ—Å–∏ –±–ª—è–¥–∏–Ω–∞ —Ç—É–ø–∞—è –∏ –æ–Ω–∞ —Å—Ä–∞–∑—É –ø—Ä–∏–Ω–∏–º–∞–µ—Ç—å—Å—è —Å–æ—Å–∞—Ç—å –∏–¥–µ–∞–ª—å–Ω–æ –¥–∞. ',
'–ö–æ–≥–¥–∞ —Ç–≤–æ—è –º–∞—Ç—å –≤—ã—Ö–æ–¥–∏—Ç –Ω–∞ —Ä–∏–Ω–≥ –º–µ—Å—Ç–æ —Ç–æ–≥–æ —á—Ç–æ–±—ã –¥—Ä–∞—Ç—å—Å—è –æ–Ω–∞ —Å—Ç—è–≥–∏–≤–∞–µ—Ç —Å –±–æ–∫—Å–µ—Ä–æ–≤ —à—Ç–∞–Ω—ã –∏ –ø—Ä–∏–Ω–∏–º–∞–µ—Ç—å—Å—è —Å–æ—Å–∞—Ç—å –Ω–µ –±—É–¥—É –¥–æ–ª–≥–æ –≤–≤–µ—Å—Ç–∏ –¥–∏–∞–ª–æ–≥ –Ω–æ —Ç–≤–æ—è –º–∞—Ç—å —à–ª—é—Ö–∞ –∏ –≤—Å–µ –º—ã œ∂—Ç–æ –ø—Ä–µ–∫—Ä–∞—Å–Ω–æ –∑–Ω–∞–µ–º. ',
'–ü–æ –∫–∞–π—Ñ—É —Ç–≤–æ—è –º–∞—Ç—å —Å–æ—Å–µ—Ç –ø–æ–∫—É—Ä–∏—à—å –∫–æ—Å—è–∫ –∏ —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞—á–∏–Ω–∞–µ—Ç —Å–æ—Å–∞—Ç—å –Ω–æ —Ç–∞–∫ –∞–∫ –º—ã –¥–∞–∂–µ –Ω–µ –ø–æ–Ω–∏–º–∞–µ–º —á—Ç–æ –ø—Ä–æ–∏—Å—Ö–æ–¥–∏—Ç –º—ã –Ω–∞—á–∏–Ω–∞–µ–º –µ–µ –ø–∏–∑–¥–∏—Ç—å –∫–∞–∫ –ø–æ—Å–ª–Ω–µ–¥–Ω–∏—é —à–∞–ª–∞–≤—É –Ω–æ –¥–∞–∂–µ –ø–æ—Å–ª–µ œ∂—Ç–æ–≥–æ –æ–Ω–∞ –Ω–µ –ø–µ—Ä–µ—Å—Ç–∞–≤–∞–ª–∞ –Ω–∞–º —Å–æ—Å–∞—Ç—å. ',
