'–ü–æ—Å—Ç–µ–ø–µ–Ω–Ω–æ —Ç–≤–æ—è –º–∞—Ç—å –ø—Ä–µ–≤—Ä–∞—â–∞–ª–∞—Å—å –≤ –Ω–æ—Ä–º–∞–ª—å–Ω—É—é –∂–µ–Ω—â–∏–Ω—É –Ω–æ –≤ –æ–¥–∏–Ω –º–æ–º–µ–Ω—Ç –æ–ø—è—Ç—å —Å–æ—Ä–≤–∞–ª–∞—Å—å –∏ –Ω–∞—á–∞–ª–∞ –¥–∞–≤–∞—Ç—å —Å–≤–æ—é –ø–∏–∑–¥—É –Ω–∞ —Ä–∞–∑—Ä—ã–≤ –≤—Å–µ–º—É —Ä–∞–π–æ–Ω—É —Ç—ã –≤–Ω–∞—Ç—É—Ä–µ —Ö–æ—á–µ—à—å –µ—ë —Å–µ–π—á–∞—Å –≤—ã—Å—Ç–∞–≤–∏—Ç—å –∫–∞–∫ –∫—É–ª—å—Ç—É—Ä–Ω—É—é –∂–µ–Ω—â–∏–Ω—É —Ö–æ—Ç—è —Å–∞–º –≤–∏–¥–µ–ª —á—Ç–æ –æ–Ω–∞ –Ω–∞—à–∏ —Ö—É–∏ –≤ —Å–≤–æ–π —Ä–æ—Ç –ø—Ä–æ–ø–∏—Ö–∏–≤–∞–ª–∞. ',
