            await self.client.send_message(message.peer_id, f"<b>üíéüî•‚ùó‚ùå‚≤éÍ§ï‚≤áÍ§Ä‚≤•‚≤ß‚≤Å‚≤ßÍ§Ä—á‚≤èÍ§Ä ‚≤Å‚≤£‚≤Ö·Éß‚≤ôÍ§ï‚≤è‚≤ßÍ§Äêå±‚ùå‚ùóüî•üíé</b>")
