    async def kowainfocmd(self, message: Message):
        """‚Äî üëæêåøÍ§Ä”Ñ‚≤Å‚≥Ö—ãêå±‚≤ÅÍ§ï‚≤ß ‚≤ßêå±Í§Äœç ·•∞‚≤£Í§Ä·É∂œÖ·†ï—åüëæ"""

        mload = await utils.answer(message, self.strings("load"))
        await mload.delete()

        if self.config["custom_button"]:
            await self.inline.form(
                message=message,
                text=self._render_info(True),
                reply_markup=self._get_mark(),
                **(
                    {"photo": self.config["media_url"]}
                    if self.config["media_url"]
                    else {}
                ),
            )
        else:
            await utils.answer_file(
                message,
                self.config["media_url"],
                self._render_info(False),
            )

